class AcSwaggerResources{
static Map<String,String> files={
"/index.css":'html {'
'\n    box-sizing: border-box;'
'\n    overflow: -moz-scrollbars-vertical;'
'\n    overflow-y: scroll;'
'\n}'
'\n'
'\n*,'
'\n*:before,'
'\n*:after {'
'\n    box-sizing: inherit;'
'\n}'
'\n'
'\nbody {'
'\n    margin: 0;'
'\n    background: #fafafa;'
'\n}'
'\n',
"/index.html":'<!-- HTML for static distribution bundle build -->'
'\n<!DOCTYPE html>'
'\n<html lang="en">'
'\n  <head>'
'\n    <meta charset="UTF-8">'
'\n    <title>Swagger UI</title>'
'\n    <link rel="stylesheet" type="text/css" href="./swagger-ui.css" />'
'\n    <link rel="stylesheet" type="text/css" href="index.css" />'
'\n    <link rel="icon" type="image/png" href="./favicon-32x32.png" sizes="32x32" />'
'\n    <link rel="icon" type="image/png" href="./favicon-16x16.png" sizes="16x16" />'
'\n  </head>'
'\n'
'\n  <body>'
'\n    <div id="swagger-ui"></div>'
'\n    <script src="./swagger-ui-bundle.js" charset="UTF-8"> </script>'
'\n    <script src="./swagger-ui-standalone-preset.js" charset="UTF-8"> </script>'
'\n    <script src="./swagger-initializer.js" charset="UTF-8"> </script>'
'\n  </body>'
'\n</html>'
'\n',
"/oauth2-redirect.html":'<!doctype html>'
'\n<html lang="en-US">'
'\n<head>'
'\n    <title>Swagger UI: OAuth2 Redirect</title>'
'\n</head>'
'\n<body>'
'\n<script>'
'\n    \'use strict\';'
'\n    function run () {'
'\n        var oauth2 = window.opener.swaggerUIRedirectOauth2;'
'\n        var sentState = oauth2.state;'
'\n        var redirectUrl = oauth2.redirectUrl;'
'\n        var isValid, qp, arr;'
'\n'
'\n        if (/code|token|error/.test(window.location.hash)) {'
'\n            qp = window.location.hash.substring(1).replace(\'?\', \'&\');'
'\n        } else {'
'\n            qp = location.search.substring(1);'
'\n        }'
'\n'
'\n        arr = qp.split("&");'
'\n        arr.forEach(function (v,i,_arr) { _arr[i] = \'"\' + v.replace(\'=\', \'":"\') + \'"\';});'
'\n        qp = qp ? JSON.parse(\'{\' + arr.join() + \'}\','
'\n                function (key, value) {'
'\n                    return key === "" ? value : decodeURIComponent(value);'
'\n                }'
'\n        ) : {};'
'\n'
'\n        isValid = qp.state === sentState;'
'\n'
'\n        if (('
'\n          oauth2.auth.schema.get("flow") === "accessCode" ||'
'\n          oauth2.auth.schema.get("flow") === "authorizationCode" ||'
'\n          oauth2.auth.schema.get("flow") === "authorization_code"'
'\n        ) && !oauth2.auth.code) {'
'\n            if (!isValid) {'
'\n                oauth2.errCb({'
'\n                    authId: oauth2.auth.name,'
'\n                    source: "auth",'
'\n                    level: "warning",'
'\n                    message: "Authorization may be unsafe, passed state was changed in server. The passed state wasn\'t returned from auth server."'
'\n                });'
'\n            }'
'\n'
'\n            if (qp.code) {'
'\n                delete oauth2.state;'
'\n                oauth2.auth.code = qp.code;'
'\n                oauth2.callback({auth: oauth2.auth, redirectUrl: redirectUrl});'
'\n            } else {'
'\n                let oauthErrorMsg;'
'\n                if (qp.error) {'
'\n                    oauthErrorMsg = "["+qp.error+"]: " +'
'\n                        (qp.error_description ? qp.error_description+ ". " : "no accessCode received from the server. ") +'
'\n                        (qp.error_uri ? "More info: "+qp.error_uri : "");'
'\n                }'
'\n'
'\n                oauth2.errCb({'
'\n                    authId: oauth2.auth.name,'
'\n                    source: "auth",'
'\n                    level: "error",'
'\n                    message: oauthErrorMsg || "[Authorization failed]: no accessCode received from the server."'
'\n                });'
'\n            }'
'\n        } else {'
'\n            oauth2.callback({auth: oauth2.auth, token: qp, isValid: isValid, redirectUrl: redirectUrl});'
'\n        }'
'\n        window.close();'
'\n    }'
'\n'
'\n    if (document.readyState !== \'loading\') {'
'\n        run();'
'\n    } else {'
'\n        document.addEventListener(\'DOMContentLoaded\', function () {'
'\n            run();'
'\n        });'
'\n    }'
'\n</script>'
'\n</body>'
'\n</html>'
'\n',
